    [],nt"revision_timestamp": "2015-05-07T15:25:09.757026",nt"name": "human-systems-integration-processes-hsip-project",nt"isopen":
    true,nt"url": null,nt"notes": "&lt;p&gt;In FY12, this project removed the
    commercial-specific content from the Commercial Human-Systems Integration Design
    Processes (CHSIP), identified gaps in the documented design processes, and generated
    5 new process chapters. The new chapters were based on human spaceflight (HSF) program
    needs and covered a large breadth of topics, from Legibility Evaluation to Design
    for Decompression Sickness Mitigation. In FY13, the approach is to conduct a Human
    Health and Performance (HH&amp;amp;P) review of the HSIP, and baseline the content
    for knowledge capture of HH&amp;amp;P processes and lessons learned, for training
    of new employees, and for use by current and future HSF programs.&lt;br /&gt;&amp;nbsp;&lt;/p&gt;",nt"license_title":
